import React, { Component } from 'react';
import axios from 'axios'

class Api extends Component {
    state = { 
        userData: []
     }

    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/users')
        .then(response => {
            // console.log(response)
            this.setState({
                userData: response.data
            })
            // console.log(this.state.userData[0].address)
            // console.log(this.state.userData[0])
            // let address = this.state.userData[0].name
            // console.log(address.geo.lat)
        })
        .catch(error => {
            console.log(error)
        })
    }
    mainData = () => {
        return(
            <div>
                <table className="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td>Larry</td>
      <td>the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>
            </div>
        )
    }
    render() { 
        return ( 
            <div>
                {mainData}
            </div>
         );
    }
}

export default Api;
